Toyota is similar to:
 Volkswagen in that it's a car company, and it's a company that produces cars. It's not a car company that makes trucks.

So it's not surprising that the company would be interested in developing a truck.

The U.S. Department of Transportation, however, is not a car company. It's a highway safety agency.

The DOT is responsible for making sure that the truck you buy is safe to drive.

But the agency has a pretty broad definition of what it means to be safe to drive.

The DOT defines safety to drive as a vehicle that:

Is capable of safely and effectively operating on all roadways;

Is designed to be driven safely and effectively on all roadways;

Is equipped with equipment and systems designed to prevent the driver from becoming involved in an accident;

Is equipped with equipment and systems designed to reduce the risk of the driver becoming involved in an accident;

Has a seat belt that meets the Federal Motor Vehicle Safety Standard and the International Traffic in Arms Regulations;

Is equipped with a seat belt that is at least four times the nominal weight of the driver;

